// Class methods

mdl_female_bones::mdl_female_bones(void) : m_female_BonW(N_VERTS_3, std::vector<double>(N_BONES, 0))
{
    // BonW
    for (unsigned int i = 0; i < N_VERTS_3; ++i) {
        for (unsigned int j = 0; j < N_BONES; ++j) {
            m_female_BonW[i][j] = c_female_bone_weights[i][j];
        }
    }
}

std::vector< std::vector<double> > &mdl_female_bones::getBonW(void) const {
    return const_cast<std::vector< std::vector<double> >&>(m_female_BonW);
}

